    ((!self->_lastUpdatedAt && !other->_lastUpdatedAt) || [self->_lastUpdatedAt isEqual:other->_lastUpdatedAt])
    &&
    ((self->_flags.has_feedbackState && other->_flags.has_feedbackState && self->_feedbackState == other->_feedbackState) || (!self->_flags.has_feedbackState && !other->_flags.has_feedbackState))
    &&
    ((!self->_stateDescription && !other->_stateDescription) || [self->_stateDescription isEqual:other->_stateDescription])
    ;
}

- (NSUInteger)hash
{
    [self readAll:YES];
    NSUInteger value = 0;

    return value
    ^
    (self->_flags.has_type ? PBHashInt((NSUInteger)self->_type) : 0)
    ^
    [self->_title hash]
    ^
    [self->_createdAt hash]
    ^
    [self->_lastUpdatedAt hash]
    ^
    (self->_flags.has_feedbackState ? PBHashInt((NSUInteger)self->_feedbackState) : 0)
    ^
    [self->_stateDescription hash]
    ;
}

- (void)mergeFrom:(GEORPFeedbackOverview *)other
{
    [other readAll:NO];
    if (other->_flags.has_type)
    {
        self->_type = other->_type;
        self->_flags.has_type = 1;
    }
    if (other->_title)
    {
        [self setTitle:other->_title];
    }
    if (self->_createdAt && other->_createdAt)
    {
        [self->_createdAt mergeFrom:other->_createdAt];
    }
    else if (!self->_createdAt && other->_createdAt)
    {
        [self setCreatedAt:other->_createdAt];
    }
    if (self->_lastUpdatedAt && other->_lastUpdatedAt)
    {
        [self->_lastUpdatedAt mergeFrom:other->_lastUpdatedAt];
    }
    else if (!self->_lastUpdatedAt && other->_lastUpdatedAt)
    {
        [self setLastUpdatedAt:other->_lastUpdatedAt];
    }
    if (other->_flags.has_feedbackState)
    {
        self->_feedbackState = other->_feedbackState;
        self->_flags.has_feedbackState = 1;
    }
    if (other->_stateDescription)
    {
        [self setStateDescription:other->_stateDescription];
    }
}

- (PBUnknownFields *)unknownFields
{
    if (_flags.read_unknownFields) return _unknownFields;
    os_unfair_lock_lock_with_options(&_readerLock, OS_UNFAIR_LOCK_DATA_SYNCHRONIZATION);
    PBDataReader *reader = _reader;
    os_unfair_lock_unlock(&_readerLock);
    if (!reader) return _unknownFields;
    @synchronized(reader) {
        if (!_flags.read_unknownFields) {
            static const uint32_t tags[] = {TAG_UNKNOWN_FIELDS, 0};
            GEORPFeedbackOverviewReadSpecified(self, reader, tags);
        }
    }
    return _unknownFields;
}
- (void)clearUnknownFields:(BOOL)recursively
{
    _flags.read_unknownFields = 1;
    _flags.wrote_unknownFields = 1;
    _unknownFields = nil;
    if (!recursively) {
        return;
    }
    [self readAll:NO];
    [_createdAt clearUnknownFields:YES];
    [_lastUpdatedAt clearUnknownFields:YES];
}

@end


